import type { ReactElement } from "react"
import styles from "./Header.module.css";
import { ReactComponent as HeaderShape } from "./src/Header.svg";
import { ReactComponent as HeaderStroke } from "./src/Header(Stroke).svg";

export interface HeaderProps {

}

export function Header(props: HeaderProps): ReactElement {
    return (
        <div className={styles.Header}>
            <HeaderShape className={styles.HeaderShape}/>
            <HeaderStroke className={styles.HeaderStroke}/>
        </div>
    )
}
